    private String buildMatchKey() {
        matchKey = getServiceKey();
        if (StringUtils.isNotEmpty(protocol)) {
            matchKey = getServiceKey() + GROUP_CHAR_SEPARATOR + protocol;
        }
        return matchKey;
    }

