    @Transient
    public Map<String, String> getAllParams() {
        if (consumerParams != null) {
            Map<String, String> allParams =
                    new HashMap<>((int) ((params.size() + consumerParams.size()) / 0.75f + 1));
            allParams.putAll(params);
            allParams.putAll(consumerParams);
            return allParams;
        }
        return params;
